export const getIcon = (index, className = "") => {
  // let MrClassName = `img-fluid ${param}`
  switch (index) {
    case "BTC":
      return <Bitcoin className={className} />;
    case "ETH":
      return <EthIcon className={className} />;
    case "BNB":
      return <BNBIcon className={className} />;
    case "SOL":
      return <SolIcon className={className} />;
    case "AVAX":
      return <AvaIcon className={className} />;
    case "MLN":
      return <EnzIcon className={className} />;
    case "NMR":
      return <NumIcon className={className} />;
    case "UMA":
      return <UmaIcon className={className} />;
    case "ADA":
      return <CarIcon className={className} />;
    case "BAT":
      return <BatIcon className={className} />;
    case "SYS":
      return <SysIcon className={className} />;
    case "WSBT":
      return <WsbIcon className={className} />;
    case "DOGE":
      return <DogeIcon className={className} />;
    case "AAA":
      return <img src={MRLogo} height="50px" width="50px" className={`img-fluid ${className}`} alt="img" />;
    case "SHIB":
      console.log(className)
      return <ShibIcon className={className} />;
    default:
      return "";
  }
};
